const AddVideo = (e) => {

    const[video,setVideo]=useState({

      time: "1year ago",
      channel: "yt",
      valid:true
    });

    function handleSubmit(e){

      console.log(e.target.value,e.target.name);
      setVideo({...video,[e.target.name]:[e.target.value]});
      console.log(video);
    }
  return (
    <form > 
        <input type="text" name='title' onChange={handleSubmit} placeholder='title'/>
        <input type="text" name='value' onChange={handleSubmit} placeholder='views'/>
        <button>Click me </button>
    </form>
  )
}

export default AddVideo;
